アルミ芯材を入れた高強度ABS樹脂を基材にステンレス箔で表面を加工。<br>現行メタカラー同様の加工性と施工性を実現し、更に剛性も30％アップ(従来比)した軽量コーナー材です。<br><br>
長さ：3000mm<br>
梱包入数：8本/梱<br><br>こちらのページではSK-15コーナーX10のみ販売しております。<br><br>
